import React from 'react'

const Header = () => {
    return (
      <header class="header">
        some text
        <video autoplay muted loop id="myVideo">
          <source
            src="../src/assets/images/pexels-yauheni-vasilevich-7101913.mp4"
            type="video/mp4"
          />
        </video>
      </header>
    );
}

export default Header
